import React from 'react';

import Icon, { AvailableIcons } from '@/components/atoms/img/Icon';
import Button from '@/components/atoms/button/Button';
import Text, { TextSize } from '@/components/atoms/text/Text';

import {
  Container,
  HeroContainer,
  ButtonContainer,
} from './styles';

const Hero: React.FC = () => (
  <Container>
    <HeroContainer>
      <div>
        <Icon iconName={AvailableIcons.logo} />

        <div>
          <Text size={TextSize.large}>Sua plaforma de</Text>
          <Text size={TextSize.large}>estudos online.</Text>
        </div>
      </div>

      <Icon iconName={AvailableIcons.logo} />
    </HeroContainer>

    <ButtonContainer>
      <div>
        <Button big iconName={AvailableIcons.logo}>Estudar</Button>
        <Button big iconName={AvailableIcons.logo}>Dar aulas</Button>
      </div>

      <Text size={TextSize.small}>Total de 285 conexões já realizadas</Text>
    </ButtonContainer>
  </Container>
);

export default Hero;
